import List from './List.js';

const Todo = () => {
  const todosList = [
    {
      id: 1,
      content: '店予約する',
    },
    {
      id: 2,
      content: '卵買う',
    },
    {
      id: 3,
      content: '郵便出す',
    },
  ];
  return (
    <>
      {todosList.map(toDo => (
        <List key={toDo.id} toDos={toDo.content} />
      ))}
    </>
  );
};

export default Todo;
